import { Container, Grid } from "@mui/material";

const LandingPageTemplate = (props) => {
  return (
    <>
        <header>{props.header}</header>
        <Container>
        <Grid container columns={{ xs: 4, md: 12 }}>
  <Grid item xs={2} />
</Grid>
        </Container>
        <footer>{props.footer}</footer>
    </>
  );
}

export default LandingPageTemplate;
